B.D_=A.a(s(["Assim como o Tropical Racing, esse jogo foi desenvolvido para ser usado com \xf3culos de realidade virtual em centros de entretenimento. Sendo assim, o segundo jogo em que tive contato com o desenvolvimento VR.","\nSeu objetivo \xe9 simular um tiroteio num cen\xe1rio de faroeste. O jogo \xe9 dividido em duas vers\xf5es, uma diurna e uma noturna, sendo essa segunda composta por maior n\xedvel de a\xe7\xe3o e dificuldade.","\nCom um foco na competitividade, ao final de cada partida \xe9 exibida a pontua\xe7\xe3o do jogador e inserida numa tabela de l\xedderes, processo realizado atrav\xe9s do v\xednculo com os servidores da Simbox Studios."]),t.s)
