B.Dn=A.a(s(["Este foi um projeto de duas semanas, oriundo de um processo seletivo onde o objetivo era fazer um jogo estilo endless runner para mobile. Optei por utilizar a tem\xe1tica natalina e acabei gostando do resultado. A programa\xe7\xe3o desse projeto possui alguns diferenciais, a exemplo, foi a primeira vez que utilizei o New Input System."]),t.s)
