B.Dq=A.a(s(["A hist\xf3ria desse projeto \xe9 a seguinte: Estava eu cursando a disciplina de Intelig\xeancia Artificial na faculdade e precisava escolher um t\xf3pico de Redes Neurais para fazer um trabalho pr\xe1tico / te\xf3rico. Com isso, eu j\xe1 ciente da exist\xeancia da ferramenta ML-Agents da Unity, resolvi escolher o t\xf3pico de Machine Learning.","\nTendo o t\xf3pico escolhido e j\xe1 estudado a parte te\xf3rica, resolvi aplicar os conhecimentos na pr\xe1tica. Assim, pensei comigo mesmo: preciso de um jogo que seja multijogador, r\xe1pido de implementar e que seja divertido de jogar. A\xed que surge o cl\xe1ssico Pong na hist\xf3ria.","\nMeu principal objetivo com isso era sanar algumas d\xfavidas, tais como: 1. Consigo implementar uma IA capaz de derrotar um humano? 2. Qual ser\xe1 o comportamento desta IA, ela ir\xe1 se parecer com um jogador humano? 3. Quanto tempo ser\xe1 necess\xe1rio para trein\xe1-la?","\nEm resumo, criei duas vers\xf5es da IA. A 1.0 tendo treinado por 7 minutos, resultando numa acur\xe1cia de 80% e varia\xe7\xe3o de 20%; e a 2.0 tendo treinado por 3 horas, resultando numa acur\xe1cia de 99.4% e varia\xe7\xe3o de 1%. O resultado pode ser conferido atrav\xe9s do meu link de download do jogo ou mesmo atrav\xe9s do pr\xf3prio navegador (N\xe3o h\xe1 comandos para mobile).","\nDevido a uma falha de framerate durante o treinamento, tive que alterar o jogo de \xfaltima hora e treinar novamente o agente, resultando assim numa 2.0 inferior, embora ainda boa. Estarei deixando no play a vers\xe3o inferior est\xe1vel e estarei deixando nos arquivos a vers\xe3o verdadeira.","\nAl\xe9m da sala de aula, cheguei a ministrar uma oficina de Machine Learning utilizando esse projeto no Centro de Artes e Letras da UFSM, explicando os conceitos b\xe1sicos de ML e permitindo a intera\xe7\xe3o das pessoas com o jogo. Os materiais podem ser encontrados atrav\xe9s dos \xedcones acima desse texto."]),t.s)
