B.DI=A.a(s(["Lunar Lander foi o segundo jogo que desenvolvi na Unity. Considero ele parte fundamental do come\xe7o da minha jornada como desenvolvedor de jogos e sempre o levo com bastante carinho na mem\xf3ria.","\nAqui o jogador deve controlar uma nave espacial usando os comandos de toque na tela e rota\xe7\xe3o do dispositivo m\xf3vel atrav\xe9s do aceler\xf4metro. O jogo possui 10 fases com dificuldade progressiva e o objetivo de cada uma delas \xe9 pousar a nave em seguran\xe7a no destino indicado.","\nApesar dos gr\xe1ficos e UI serem totalmente primitivos, acredito que seja um jogo divertido de modo geral e mostra a minha evolu\xe7\xe3o como desenvolvedor."]),t.s)
