B.DV=A.a(s(["Com o surgimento do sistema de ilumina\xe7\xe3o 2D da Unity, senti vontade de fazer um projeto para test\xe1-lo na pr\xe1tica. Assim surgiu Pinky Lander, meio como um sucessor do Lunar Lander.","\nA ideia aqui \xe9 bem similar, o jogador controla uma esp\xe9cie de nave atrav\xe9s do aceler\xf4metro do celular e toques na tela. Com adi\xe7\xe3o de algumas mec\xe2nicas, como a de toque com um dedo para acelera\xe7\xe3o lenta e dois dedos para acelera\xe7\xe3o r\xe1pida. Outra mec\xe2nica \xe9 que agora o dano de colis\xe3o passou a ser bem menos punitivo, apenas em casos de velocidade muito alta.","\nA minha ideia inicial era p\xf4r o jogo na Play Store, entretanto, devido \xe0 m\xe1 otimiza\xe7\xe3o da ilumina\xe7\xe3o 2D em dispositivos m\xf3veis na \xe9poca, o projeto acabou ficando engavetado. Agora durante o desenvolvimento deste site resolvi resgatar o projeto e ver como ele est\xe1. Notei que algumas luzes acabaram se comportando de maneira estranha na transi\xe7\xe3o do projeto para a Unity 2022.2.0f1, mas resolvi gerar uma release do aplicativo ainda assim para quem quiser testar."]),t.s)
B.DW=A.a(s(["Por \xfaltimo, n\xe3o h\xe1 muito o que dizer sobre esse projeto, mas resolvi inclu\xed-lo aqui na lista por ter sido um estudo de cen\xe1rio infinito. Escolhi a abordagem de gerar blocos de mapa e ir posicionando eles dinamicamente conforme a nave avan\xe7a, dessa forma impe\xe7o a gera\xe7\xe3o de cen\xe1rios imposs\xedveis.","\nNunca cheguei a finalizar esse projeto, nem mesmo cheguei a nome\xe1-lo, mas tempos depois utilizei a mesma abordagem para desenvolver o Santa is Late for Christmas!"]),t.s)
