B.E0=A.a(s(["Projeto desenvolvido atrav\xe9s da Rota Simuladores. Seu intuito \xe9 atuar como ferramenta auxiliar para motoristas de \xf4nibus e caminh\xe3o atrav\xe9s da simula\xe7\xe3o de f\xedsica e dirigibilidade real\xedstica. Juntamente com a simula\xe7\xe3o de ve\xedculos, foi tamb\xe9m desenvolvido um sistema para cria\xe7\xe3o de aulas. Atuei neste projeto como desenvolvedor principal.","\nO simulador funciona no hardware da Rota Simuladores, nos dispositivos G29 e G920 da Logitech, assim como no PC e joysticks."]),t.s)
B.E1=A.a(s(["Tropical Racing \xe9 um jogo de corrida arcade voltado para o uso em cockpits automobil\xedsticos com suporte \xe0 force feedback e motion feedback.","\nEsse foi o primeiro projeto em que tive contato com esse tipo de hardware. O pr\xf3prio contato com um jogo de corrida tamb\xe9m me auxiliou muito para o desenvolvimento do simulador automobil\xedstico posteriormente.","\nEste acabou sendo um dos projetos mais divertidos que participei, uma vez que seu desenvolvimento proporcionou uma \xf3tima intera\xe7\xe3o entre a equipe na \xe9poca, onde frequentemente disput\xe1vamos para ver quem era o jogador com melhor tempo."]),t.s)
