B.E7=A.a(s(["Este foi o primeiro projeto em que tive contato com o desenvolvimento de jogos para o uso em Realidade Virtual, na \xe9poca com um Oculus Rift e um Oculus Rift S.","\nO jogo consiste em uma pequena cena para ser utilizada em centros de entretenimentos locais e seu intuito \xe9 simular uma travessia em grande altitude para proporcionar sensa\xe7\xf5es de adrenalina aos jogadores."]),t.s)
B.Ed=A.a(s(["Esse projeto surgiu atrav\xe9s da minha paix\xe3o por Dark Souls. Sempre admirei o sistema de combate souls, ent\xe3o resolvi aproveitar a oportunidade para fazer um projeto onde o intuito fosse batalhar contra um chefe, usando as mec\xe2nicas tradicionais.","\nPor tr\xe1s das cortinas havia um motivo que me fazia querer investir ainda mais nesse projeto, que era a oportunidade de me aperfei\xe7oar em anima\xe7\xf5es de modo geral e na l\xf3gica de movimenta\xe7\xe3o e intera\xe7\xe3o de personagens. O que ainda \xe9, at\xe9 hoje, o projeto que mais me possibilitou crescer neste t\xf3pico.","\nAproveitando o meu estudo, resolvi disponibilizar um v\xeddeo demonstrativo do projeto no Youtube e posteriormente disponibilizei o c\xf3digo fonte no GitHub para quem pudesse se beneficiar dele.","\nPor fim, acabou sendo uma boa abordagem pois foi interessante ver a intera\xe7\xe3o do p\xfablico e me motivou a seguir com esse tipo de projeto, posteriormente entrando para o time do Rogue Masters; projeto onde encontro-me trabalhando atualmente e consta no topo deste portf\xf3lio.","\nAinda possuo planos de fazer um projeto de combate mais aprimorado utilizando a Unreal Engine 5 em algum futuro pr\xf3ximo."]),t.s)
