B.Ej=A.a(s(["Rogue Masters \xe9 o jogo onde me encontro trabalhando atualmente, atrav\xe9s da Advance Garde. O jogo constitui-se de uma mescla dos estilos rogue-like e souls-like, onde seu objetivo \xe9 combater a entropia numa batalha de hordas que podem ser jogadas em modo cooperativo ou sozinho.","\nPara mim foi uma honra ter entrado para o time pois sempre admirei muito o estilo souls. Sendo este um jogo cooperativo e com lan\xe7amento na Steam, tive a oportunidade de me aprimorar em diversas funcionalidades, tais como networking, server e cloud saving; al\xe9m de outros recursos como mapeamento de teclas e sistema de UI de modo geral.","\nO acesso \xe0 p\xe1gina da loja Steam e ao trailer no Youtube podem ser encontrados atrav\xe9s dos \xedcones acima desse texto, assim como em alguns outros projetos deste portf\xf3lio."]),t.s)
